import React from 'react'
import {useNavigate}  from 'react-router-dom'
function Home() {
    const navigate = useNavigate()
  return (
    <div className='flex justify-center items-center h-screen w-screen'>
        <p className='text-red-400 text-3xl'>Click here to login</p>
        <button onClick={()=>{
            navigate('login')
        }}>login</button>

<p className='text-red-400 mt-4 text-6xl'>Visit store</p>

        <button onClick={()=>{
            navigate('store')
        }}>Store</button>
    </div>
  )
}

export default Home
